interface Theme {
  title: string,
  colors: {
    primary: string,
    secondary: string,
    tertiary: string,

    white: string,
    black: string,
    gray: string,

    success: string,
    info: string,
    warning: string,
  },
}

export const dark:Theme = {
  title: 'dark',
  colors: {
    primary: '#1B1F38',
    secondary: '#252A48',
    tertiary: '#313862',

    white: '#FFFFFF',
    black: '#000000',
    gray: '#BFBFBF',

    success: '#4E41F0',
    info: '#F7931B',
    warning: '#E44C4E',
  },
};

export const light:Theme = {
  title: 'light',
  colors: {
    primary: '#DCDCDC',
    secondary: '#FFFFFF',
    tertiary: '#F5F5F5',

    white: '#000000',
    black: '#FFFFFF',
    gray: '#BFBFBF',

    success: '#03BB85',
    info: '#3B5998',
    warning: '#FF6961',
  },
};
